import React from 'react'
import { Link } from 'react-router-dom'

const Profile = () => {
  return (
    <div>
      <Link to="/card">hello</Link>

      <Link to="/rooms">hello</Link>

      <Link to="/chatbox">Hello chat room</Link>

    </div>
  )
}

export default Profile
